import React from 'react'
import classes from './People.module.css'

export default function People() {
  return (
    <Fragment>
    <div className={classes.dashboard}>
      <h1>Dashboard</h1>
      {/* <span>39 People</span> */}
      {/* <Input /> */}
      <img src={image} style ={{background: "white"}} />
    </div>
    <SideBar />
  </Fragment>
  )
}
